create table `#__rw_countries`
(
    id    int auto_increment
        primary key,
    title varchar(100) not null comment 'Название страны',
    constraint `#__rw_countries_title_uindex`
        unique (title)
)
    comment 'Страны';

create table `#__rw_regions`
(
    id        int auto_increment
        primary key,
    countryID int          not null,
    title     varchar(255) not null,
    constraint `#__rw_regions_#__rw_countries_id_fk`
        foreign key (countryID) references `#__rw_countries` (id)
            on update cascade on delete cascade
)
    comment 'Регионы';

create index `#__rw_regions_title_index`
    on `#__rw_regions` (title);

create table `#__rw_stations`
(
    id       int auto_increment
        primary key,
    title    text not null comment 'Название станции',
    regionID int  not null comment 'ID региона',
    yandex   int  not null comment 'ID станции в Яндексе',
    esr      int  not null comment 'Код ЕСР',
    constraint `#__rw_stations_#__rw_regions_id_fk`
        foreign key (regionID) references `#__rw_regions` (id)
            on update cascade on delete cascade
);

create index `#__rw_stations_esr_index`
    on `#__rw_stations` (esr);

create index `#__rw_stations_yandex_index`
    on `#__rw_stations` (yandex);




create or replace view `#__rw_railway` as
select s.id, s.title, r.title as region, c.title as country, s.yandex, s.esr
from `#__rw_stations` s
         left join `#__rw_regions` r on r.id = s.regionID
         left join `#__rw_countries` c on r.countryID = c.id